import React from 'react'

import { BrowserRouter, Switch, Route } from 'react-router-dom'

import AtendimentoPage from './pages/AtendimentoPage'

export default function Routes() {
    return(
        <BrowserRouter>
            <Switch>
                <Route exact path="/" component={AtendimentoPage} />
            </Switch>
        </BrowserRouter>
    )
}
